const catalogo = [
  { titulo: "Interstellar", tipo: "pelicula", imagen: "data:image/jpeg;base64," },
  { titulo: "Breaking Bad", tipo: "serie", imagen: "https://m.media-amazon.com/images/I/51O2ySDwX8L._AC_UF894,1000_QL80_.jpg" },
  { titulo: "God of War", tipo: "juego", imagen: "https://i.ebayimg.com/images/g/7N0AAOSwsKJkEdsb/s-l400.jpg" },
  { titulo: "The Batman", tipo: "pelicula", imagen:  "data:image/jpeg;base64," },
  { titulo: "Stranger Things", tipo: "serie", imagen: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRj_KUd5xfpl3B80gizq2IWS1hHTDUkr284jw&s" },
  { titulo: "Red Dead Redemption 2", tipo: "juego", imagen: "https://i5.walmartimages.com/seo/Red-Dead-Redemption-2-Vedio-Game-Poster-and-Prints-Unframed-Wall-Art-Gifts-Decor-12-x-18-inch-30cm-x-46cm_3e60832e-babb-495b-8133-fb01a92092a7.abc48332075e6c8a8c190b8ce056b9f3.jpeg" },
  { titulo: "Inception", tipo: "pelicula", imagen: "data:image/jpeg;base64," },
  { titulo: "The Witcher", tipo: "serie", imagen: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSXkpyPljN4lyJYQkftZu4XFt9-SD0zeaEoRg&s" },
  { titulo: "Baiche", tipo: "juego", imagen: "data:image/jpeg;base64," },
  { titulo: "Meka", tipo: "serie", imagen: "data:image/jpeg;base64," },
];

const catalogoCont = document.getElementById("catalogo");
const tendenciasCont = document.getElementById("tendencias");
const botones = document.querySelectorAll(".filtro");

function renderCatalogo(filtro = "todo") {
  // gsap.to(catalogoCont, {
  //   opacity: 0,
  //   duration: 0.2,
  //   onComplete: () => {
    gsap.from(catalogoCont.children, {
  opacity: 0,
  stagger: 0.1,
  duration: 0.5,
});
      catalogoCont.innerHTML = "";

      const filtrados =
        filtro === "todo" ? catalogo : catalogo.filter((i) => i.tipo === filtro);

      filtrados.forEach((item) => {
        const card = document.createElement("div");
        card.className = "flex flex-col h-[440px] bg-gray-800 overflow-hidden shadow-lg transition-transform duration-300";

        card.innerHTML = `<div class="h-[320px] w-full overflow-hidden">
    <img src="${item.imagen}" alt="${item.titulo}" class="h-full w-full object-cover object-center" />
  </div>
  <div class="flex-1 px-4 py-3 flex flex-col justify-center bg-black/70 backdrop-blur-sm transition-transform duration-300"
       style="margin-top:-10px;">
    <h4 class="font-semibold text-lg text-white leading-tight mb-1">${item.titulo}</h4>
    <p class="text-sm text-gray-300 capitalize">${item.tipo}</p>
  </div>
      `;
        card.addEventListener("mouseenter", () => {
          card.querySelector("div.flex-1").style.transform = "translateY(-8px)";
          card.querySelector("div.flex-1").style.boxShadow = "0 4px 16px rgba(0,0,0,0.3)";
        });
        card.addEventListener("mouseleave", () => {
          card.querySelector("div.flex-1").style.transform = "none";
          card.querySelector("div.flex-1").style.boxShadow = "none";
        });

        catalogoCont.appendChild(card);
      });

      // gsap.from(catalogoCont.children, {
      //   opacity: 0,
      //   y: 30,
      //   stagger: 0.1,
      //   duration: 0.5,
      // });
      // gsap.to(catalogoCont, { opacity: 1, duration: 0.3 });
  //   },
  // });
}

function renderTendencias() {
  tendenciasCont.innerHTML = "";
  catalogo.slice(0, 5).forEach(item => {
    const card = document.createElement("div");
    card.className =
  "flex flex-col h-[430px] bg-gray-800 overflow-hidden shadow-lg transition-transform duration-300";

card.innerHTML = `
  <div class="h-[320px] w-full overflow-hidden">
    <img src="${item.imagen}" alt="${item.titulo}" class="h-full w-full object-cover object-center" />
  </div>
  <div class="flex-1 px-4 py-3 flex flex-col justify-center bg-black/70 backdrop-blur-sm transition-transform duration-300"
       style="margin-top:-10px;">
    <h4 class="font-semibold text-lg text-white leading-tight mb-1">${item.titulo}</h4>
    <p class="text-sm text-gray-300 capitalize">${item.tipo}</p>
  </div>
`;

card.addEventListener("mouseenter", () => {
  card.querySelector("div.flex-1").style.transform = "translateY(-8px)";
  card.querySelector("div.flex-1").style.boxShadow = "0 4px 16px rgba(0,0,0,0.3)";
});
card.addEventListener("mouseleave", () => {
  card.querySelector("div.flex-1").style.transform = "none";
  card.querySelector("div.flex-1").style.boxShadow = "none";
});
tendenciasCont.appendChild(card);
  });
}

botones.forEach(btn => {
  btn.addEventListener("click", () => {
    botones.forEach(b => b.classList.remove("text-indigo-400"));
    btn.classList.add("text-indigo-400");
    renderCatalogo(btn.dataset.tipo);
  });
});

renderCatalogo();
renderTendencias();
gsap.from(".filtro", {opacity: 0, y: -20, stagger: 0.1});
gsap.from("section", {opacity: 0, y: 30, duration: 1, delay: 0.5});
